INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('4e8b98d0-8a3f-4a5b-a455-2837b8c95261', 'Excelente servicio', 5, 'Estoy muy satisfecho con el servicio brindado por esta niñera.', 'ad9f0c0c-d37c-4daa-a998-c66a5e5dc056', 'db62686b-8bd0-4ede-a398-4eb240f161b5');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('fe5f1198-3c9f-40cc-8763-8416a2f735ed', 'Buena atención', 4, 'La niñera fue atenta y cuidadosa con mis hijos durante toda la tarde.', 'c4c561f6-d471-4c3b-b1d6-22cb07bb15ff', '8f41461f-a6d3-4fcd-87da-e9a7d38b3e62');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('c729d662-af45-4b62-9a5f-8ce70e60785f', 'Buen servicio', 4, 'La niñera demostró profesionalismo y habilidades para el cuidado de mis hijos.', 'ad9f0c0c-d37c-4daa-a998-c66a5e5dc056', 'db62686b-8bd0-4ede-a398-4eb240f161b5');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('ecbcbf5e-29b1-47c7-9c79-cb51f0a1e0a0', 'Recomendada totalmente', 5, 'Esta niñera es muy confiable y responsable, la recomendaría sin dudarlo.', 'ad9f0c0c-d37c-4daa-a998-c66a5e5dc056', '4a61e295-a9e6-4ae2-9c69-8cc6398ca89b');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('815c16b2-49a1-4d1c-a94b-40b8a2c9b80b', 'Buen trabajo realizado', 4, 'La niñera realizó un excelente trabajo cuidando de mis hijos mientras yo estaba fuera.', 'f1917995-3771-463b-b1f8-1f0d94fda0b2', 'db62686b-8bd0-4ede-a398-4eb240f161b5');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('d39b0e14-9866-44a2-8c0b-8c1f8e2a64b5', 'Necesita mejorar', 2, 'La niñera no cumplió con todas las expectativas y hubo algunas áreas en las que necesita mejorar.', 'c4c561f6-d471-4c3b-b1d6-22cb07bb15ff', '8f41461f-a6d3-4fcd-87da-e9a7d38b3e62');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('343b6196-34f4-4f7b-9922-4c4ff0a4a252', 'Muy amable', 3, 'La niñera fue amable, pero hubo momentos en los que parecía distraída y no prestó toda la atención necesaria.', '165de994-fdc6-4a9f-bbd6-7b012a19bc48', 'db62686b-8bd0-4ede-a398-4eb240f161b5');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('77b13f33-8700-4bde-9474-34858306b22a', 'Experiencia negativa', 1, 'Lamentablemente, tuve una mala experiencia con esta niñera, no la recomendaría.', '68b9a0ad-4088-4bdc-841f-2f9643fb4358', '4a61e295-a9e6-4ae2-9c69-8cc6398ca89b');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('6f4e1a57-39a5-41e9-a925-9277d3342d7f', 'Muy profesional', 5, 'La niñera mostró un alto nivel de profesionalismo y cuidó de mis hijos de manera excelente.', '68b9a0ad-4088-4bdc-841f-2f9643fb4358', 'db62686b-8bd0-4ede-a398-4eb240f161b5');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('dc47f8e4-0b17-413c-97b0-689b6a5c9380', 'No fue lo esperado', 2, 'La niñera no cumplió con las expectativas y hubo algunas situaciones incómodas durante el cuidado de mis hijos.', '088d620e-eec5-4c15-8ba1-154ef4a1c5ed', 'd005595b-999b-4afa-9f5c-544fde74c190');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('935ee22c-7d25-4784-8839-894f65f84d3a', 'Gran apoyo', 4, 'La niñera fue un gran apoyo para mí y mis hijos durante un momento difícil. Estoy agradecido por su dedicación.', '165de994-fdc6-4a9f-bbd6-7b012a19bc48', 'd005595b-999b-4afa-9f5c-544fde74c190');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('4e6b0fc1-d2e4-4b3d-aab9-3e4bc8fb8455', 'Cuidado deficiente', 1, 'Lamentablemente, la niñera no brindó el cuidado adecuado y hubo situaciones peligrosas durante su tiempo con mis hijos.', '088d620e-eec5-4c15-8ba1-154ef4a1c5ed', '69c57272-ec4f-4006-b67e-79d81db14395');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('62c5d7f7-363f-45f0-ae1e-d218cc74763a', 'Altamente recomendada', 5, 'Esta niñera es altamente recomendada. Demostró ser responsable, amable y confiable.', '68b9a0ad-4088-4bdc-841f-2f9643fb4358', '69c57272-ec4f-4006-b67e-79d81db14395');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('97ab6c23-8e4e-442e-852d-60e9e6611cc9', 'Podría mejorar', 3, 'La niñera fue decente en general, pero hubo algunas áreas en las que podría mejorar su desempeño.', 'f1917995-3771-463b-b1f8-1f0d94fda0b2', '69c57272-ec4f-4006-b67e-79d81db14395');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('1a4c8696-8b08-44a5-a633-bdfba8d25743', 'Buen cuidado', 4, 'La niñera cuidó de mis hijos de manera adecuada y se aseguró de que estuvieran seguros y cómodos.', '650c8759-ad86-48e9-ae81-05a2aa42f6f1', '69c57272-ec4f-4006-b67e-79d81db14395');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('2bebf2bb-7132-47b5-bf14-6c847ff4a6b5', 'Padre/madre responsable', 5, 'El padre/madre de este niño demostró ser extremadamente responsable y comprometido con el cuidado de su hijo.', 'a4f50176-d6a6-4c49-8d53-9720c0b02635', 'ad9f0c0c-d37c-4daa-a998-c66a5e5dc056');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('1c321611-1f88-4b63-bd9c-17923dd4c319', 'Acudiente atento', 4, 'Este acudiente estuvo muy atento a las necesidades de su hijo y proporcionó todas las instrucciones necesarias para su cuidado.', '4a61e295-a9e6-4ae2-9c69-8cc6398ca89b', 'c4c561f6-d471-4c3b-b1d6-22cb07bb15ff');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('c53302bb-d37a-4fe0-9a83-260c53231cc1', 'Excelente comunicación con el acudiente', 4, 'El acudiente de este niño mantuvo una comunicación abierta y clara en todo momento, lo cual facilitó mi labor como niñera.', '4a61e295-a9e6-4ae2-9c69-8cc6398ca89b', 'c4c561f6-d471-4c3b-b1d6-22cb07bb15ff');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('56e7b8d5-b521-4196-9ed5-7dcf7aa58091', 'Acudiente confiable', 5, 'Este acudiente demostró ser una persona confiable y segura en el cuidado de su hijo. Tuve plena confianza en dejar al niño bajo su responsabilidad.', '4a61e295-a9e6-4ae2-9c69-8cc6398ca89b', 'ad9f0c0c-d37c-4daa-a998-c66a5e5dc056');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('3020a75f-b066-4254-a401-46ab0a206b09', 'Gratitud hacia el acudiente', 4, 'Estoy muy agradecido(a) con el acudiente de este niño por su apoyo y confianza en mi labor como niñera.', 'a4f50176-d6a6-4c49-8d53-9720c0b02635', 'c4c561f6-d471-4c3b-b1d6-22cb07bb15ff');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('d1ce5b6a-cb61-4ac8-b959-e9abef0d6367', 'Excelente coordinación con el acudiente', 2, 'La coordinación con el acudiente de este niño fue deficiente, lo que dificultó el cuidado adecuado y la comunicación.', 'd005595b-999b-4afa-9f5c-544fde74c190', 'ad9f0c0c-d37c-4daa-a998-c66a5e5dc056');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('83755084-a194-4d43-ac49-558d9b6bd585', 'Acudiente colaborativo', 4, 'El acudiente de este niño fue colaborativo y estuvo dispuesto a trabajar en equipo para garantizar el bienestar del niño.', 'a4f50176-d6a6-4c49-8d53-9720c0b02635', 'ad9f0c0c-d37c-4daa-a998-c66a5e5dc056');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('33f632de-8127-4b29-af5c-ec218ee8d6eb', 'Acudiente comprometido', 5, 'El acudiente de este niño mostró un gran compromiso y dedicación en el cuidado y educación del niño.', '8f41461f-a6d3-4fcd-87da-e9a7d38b3e62', 'ad9f0c0c-d37c-4daa-a998-c66a5e5dc056');
INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('733b1989-d453-4dac-9c14-6b85748dab44', 'Buen trato por parte del acudiente', 5, 'El acudiente de este niño trató siempre con amabilidad y respeto a la niñera y se preocupó por el bienestar del niño.', '69c57272-ec4f-4006-b67e-79d81db14395', '165de994-fdc6-4a9f-bbd6-7b012a19bc48');
