INSERT INTO public.resenia_entity (id, titulo, calificacion, descripcion, "receptorId", "autorId") VALUES ('1e84c286-308a-434f-bfe8-423fcc9f53ae', 'Padre/madre colaborador(a)', 4, 'El padre/madre de este niño fue colaborador(a) y se aseguró de proporcionar todas las indicaciones necesarias para el cuidado del niño.', 'd005595b-999b-4afa-9f5c-544fde74c190', 'f1917995-3771-463b-b1f8-1f0d94fda0b2');
